import React from 'react';
import Fotorama from 'fotorama-react-wrapper'
import under_gallerie from '../img/underground_gallery.jpg';
import worker from '../img/worker.jpg';

const Gallery = () => {
  return (
    <div>
      <Fotorama
           data-allowfullscreen="true"
           data-nav="thumbs"
           data-width="800"
           data-height="600" >
            <img src="worker" />
            <img src="under_gallerie" />
        </Fotorama >  
    </div>
  );
};

export default Gallery;
